import React, { useState } from "react";
import styles from "./App.module.css";
import ExerciseCard from "./Exercisecard";
import NewExercise from "./Searchable";
import exercise from "./Exercise";
function App() {
    const [currExercise,addNewExercise]=useState([]);
    function addNewExerciseCard(exerciseName){
        addNewExercise([...currExercise,exerciseName]);
        console.log(currExercise);
    }
    const [value, setValue] = useState("");
    console.log(exercise);
    return (
        <div>
            <NewExercise
                options={exercise}
                label="name"
                id="id"
                selectedVal={value}
                handleChange={(val) => setValue(val)}
                addNewExercise={addNewExerciseCard}
            />
            <ExerciseCard exerciseName="Chest Press" />
            <ExerciseCard exerciseName="Leg Press" />
            <ExerciseCard exerciseName="Incline Press" />


        </div>
    );
}

export default App;
